import React, { Component } from "react";
//import "./App.css";

class Signup extends Component {
  constructor() {
    super();

    this.state = {
      first_name: "",
      last_name: "",
      email: "",
      phone_number: "",
      date_of_birth: "",
      street_address: "",
      city: "",
      state: "",
      country: "",
      password: ""
    };
  }

  submit() {
    console.log(this.state);

    fetch("http://127.0.0.1:8000/api/user/create", {
      method: "post",
      body: JSON.stringify(this.state),
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json"
      }
    }).then(function(response) {
      response.json().then(function(resp) {
        console.log(resp);
      });
    });
  }

  render() {
    return (
      <div className="App">
        <h1>Test api</h1>
        <input
          type="text"
          onChange={item => {
            this.setState({ username: item.target.value });
          }}
        />
        <br />
        <br />
        <input
          type="password"
          onChange={item => {
            this.setState({ password: item.target.value });
          }}
        />
        <br />
        <br />
        <button
          onClick={() => {
            this.submit();
          }}
        >
          Login
        </button>
      </div>
    );
  }
}

export default Signup;
